import { Component } from '@angular/core';

@Component({
  selector: 'app-product',
  templateUrl: './product.component.html',
  styleUrls: ['./product.component.css']
})
export class ProductComponent implements {
   id:number;
   name:string;
   price:number

constructor(){
  this.id = 1;
  this.name = 'lenova laptop';
  this.price = 30000
}
   public getId():number{
    return this.id;
   }
   public getName():string{
    return this.name;
   }
   public getPrice():number{
    return this.price;
   }

}
<h1>{{getId()}}</h1>
<h1>{{getName()}}</h1>
<h1>{{getPrice()}}</h1>
